import styled from "styled-components";

const NavBarStyled = styled.nav`
  height: 7vh;
  background-color: var(--grey-4);
  .navContainer {
    width: 48.75rem;
    display: flex;
    justify-content: space-around;
    align-items: center;
  }
`;
export default NavBarStyled;
